  constructor(){
    super()
    this.setState= {
      products:[]
    }
  }



  render(){
    return(
      <div className= "App">
        <HomePage product = {Data.map(products => {
          return(
            <div>
              {<div key={products.id}> {products.price}</div>}
              {console.log(products)}
            </div>
          )
        })}/>

      </div>
    )
  }
}

export default App;
